.block-contents {
  background-color: #2c2f11;
  color: #fff;
  width: 100%;
  height: 100vh;
  display: flex;
  align-items: center;
}

.content-container {
  margin: 0 auto;
  width: 100%;
  position: relative;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
}

.content-wrapper {
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  gap: 30px;
}

.content-title {
  font-family: "Meholrax", serif;
  font-size: 2.5rem;
  font-weight: normal;
  margin: 0;
  max-width: 400px;
  line-height: 1.2;
}

.artists-list {
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  gap: 10px;
}

.artist-item {
  font-family: "Roboto", sans-serif;
  font-size: 2.8rem;
  font-weight: 300;
  line-height: 1.2;
  color: #fff;
  transition: opacity 0.3s ease;
}

.artist-item:hover {
  opacity: 0.8;
}

.content-cta {
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
  color: #fff;
  text-decoration: none;
  margin-top: 20px;
  opacity: 0.8;
  transition: opacity 0.3s ease;
}

.content-cta:hover {
  opacity: 1;
}

.collaboration {
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  gap: 5px;
  margin-top: 40px;
}

.collaboration-text {
  font-family: "Roboto", sans-serif;
  font-size: 1rem;
  opacity: 0.7;
}

.collaboration-site {
  font-family: "Roboto", sans-serif;
  font-size: 0.9rem;
  opacity: 0.5;
}

/* Responsive styles */
@media (max-width: 768px) {
  .block-contents {
    padding: 40px 20px;
  }

  .content-title {
    font-size: 2rem;
  }

  .artist-item {
    font-size: 2.2rem;
  }
}

@media (max-width: 480px) {
  .block-contents {
    padding: 30px 15px;
  }

  .content-title {
    font-size: 1.8rem;
  }

  .artist-item {
    font-size: 1.8rem;
  }

  .content-cta {
    font-size: 0.9rem;
  }
}
